import { Router, Route } from "react-router-dom";
import New from "../pages/New";

const DrSection = () => {

    return (
        <div className="DrSection">
            <Router>
                <Route path="/diary" element={<New />}/>
                <Route path="/new" element={<New />}/>
            </Router>
        </div>
    );

}

export default DrSection;
